import React, { Component } from 'react';
import './home_image.css';
import Trucks from '../../pictures/img1.jpg';


export default class homeImage extends Component {

    render() {
        return (
            <React.Fragment>
                <img src={Trucks} className= "trucks" alt="trucks"/>
            </React.Fragment>
        )
    }
}
